const ArtistBody = props => (
  <div className="artistBody">
    <div className="artistBodyContainer">{props.children}</div>

    <style jsx>{`
      .artistBodyContainer {
        margin-top: 15px;
        width: 500px;
        border-top: 1px solid #d0d0d0;
        border-bottom: 1px solid #d0d0d0;
      }
    `}</style>
  </div>
);

export default ArtistBody;
